import { combineReducers } from 'redux';
import chartReducer from './chart';
import errorReducer from './error';
import authReducer from './authReducer';
import summaryReducer from '../components/Content/Promotions/PromoCalendar/summaryReducer';
import calendarReducer from '../components/Content/Promotions/PromoCalendar/calendarReducer';
import markDownReducer from './markDownReducer';
import markDownReducers from './markDownReducers';
import manuallyCreateMdReducer from './manuallyCreateMdReducer';
import markdownAnalysisReducer from './markdownAnalysisReducer';
import markDownFilterReducer from './markdownFilterReducer';
import globalPromoReducer from './global_promo_reducer';
import filtersReducer from './filtersReducer';
import reportingReducer from './reportingReducer';
import draftStatusReducer from './draftStatusReducer';
import finalizeReducer from './markdownFinalizeReducer';
import plannedReportReducer from './plannedReportsReducer';
import cockpitReducer from './cockpitReducer';

export default combineReducers({
  errors: errorReducer,
  chartData: chartReducer,
  authReducer: authReducer,
  summaryData: summaryReducer,
  calendar: calendarReducer,
  markdown: markDownReducer,
  markDownFilter: markDownFilterReducer,
  globalPromos: globalPromoReducer,
  markdownAnalysisData: markdownAnalysisReducer,
  manuallyCreateMdData: manuallyCreateMdReducer,
  filtersReducer: filtersReducer,
  reportingReducer,
  draftStatusReducer,
  finalizeReducer,
  plannedReportReducer,
  cockpitReducer,
  markDownReducers,
});

